// エモなしの設定にする
ClearEmotion();

function GetKeyTimes( idx, delta )
{
  let timevalue = "";
  let keyvalue = "";
  keyvalue = "0;";
  for( let i = 0; i < idx.length; i++ ){
    timevalue = ( idx[i] - 1 ) * delta;
    keyvalue += timevalue + ";" + timevalue + ";";
  }
  keyvalue += "1.0";
  return keyvalue;
}

var emo_speed = 1; // エモの速度

const BtnEmoSpeed = document.getElementById('btn_emo_speed');
BtnEmoSpeed.addEventListener( 'click', function(){
  switch(emo_speed){
    case 1: emo_speed = 2; break;
    case 2: emo_speed = 5; break;
    case 5: emo_speed = 10; break;
    case 10: emo_speed = 20; break;
    case 20: emo_speed = 50; break;
    case 50: emo_speed = 1; break;
    default: emo_speed = 1;
  }
  BtnEmoSpeed.setAttribute("value", "x" + emo_speed);
});

const BtnEmotion = document.getElementsByClassName('emotion');
for (let i = 0; i < BtnEmotion.length; i++) {
  let svg = BtnEmotion[i].getElementsByTagName("svg");
  if( 0 != svg.length ){
    svg[0].setAttribute("width","40");
    svg[0].setAttribute("height","40");
  }
  BtnEmotion[i].addEventListener('click', function() {
    ExecuteEmotion( parseInt(this.getAttribute("id").slice(7)));
  });
}

